import React from 'react'
import * as Style from './styles'

interface Button {
  children: string
  onClick?: () => void
  props?: any
}

const Button = ({ children, onClick }: Button) => {
  return (
    <Style.Container {...props} onClick={onClick}>
      {children}
    </Style.Container>
  )
}

export default Button
